import { Routes, Route } from "react-router-dom";
import './styles/App.css';
import Lobby from "./screens/Lobby";
import Room from "./screens/Room";

function App() {
  return (
    <div className="App">
    <Routes>
      <Route path="/" element={<Lobby />}></Route>
      <Route path="/Room:id" element={<Room />}></Route>
    </Routes>
    </div>
  );
}

export default App;
